import React from "react";
import PropTypes from "prop-types";
import Nav from "../Nav/Nav";

const MainLayout = ({ children }) => (
  <div>
    <Nav />
    <main>{children}</main>
  </div>
);

MainLayout.propTypes = {
  children: PropTypes.node,
};

export default MainLayout;
